    "# Chapter 2 Conceptual\n",
    "## 1. For each of parts (a) through (d), indicate whether we would generally expect the performance of a flexible statistical learning method to be better or worse than an inflexible method. Justify your answer.\n",
    "### (a) The sample size n is extremely large, and the number of predictors p is small.\n",
    "When you have a very large sample size and few predictors, flexible methods are generally more suitable.  The large dataset provides protection against overfitting, and a flexible model can more easily find useful relationships between the predictors and the dependent variable.\n",
    "### (b) The number of predictors p is extremely large, and the number of observations n is small.\n",
    "With high dimensionality and small sample size, the risk of overfitting is significant.  This is a clear example of when a more rigid model would be appropriate. Otherwise, the algorithm may find arbitrary relationships that are not predictive in another dataset.\n",
    "### (c) The relationship between the predictors and response is highly non-linear.\n",
    "An inflexible model is going to struggle greatly with capturing the relationships between the independent and dependent variables in a nonlinear system.  It's hard to fit a linear system to data that isn't linearly dependent. A more flexible model will better approximate the relationship.\n",
    "### (d) The variance of the error terms, i.e. σ2 = Var(ϵ), is extremely high.\n",
    "Linear models thrive in high-variance datasets.  A more flexible model will likely overfit to the noise in the data. A linear model will more likely not capture all the structure, but it will avoid overfitting.\n",
    "## 2. Explain whether each scenario is a classification or regression problem, and indicate whether we are most interested in inference or prediction. Finally, provide n and p.\n",
    "### (a) We collect a set of data on the top 500 firms in the US. For each firm we record profit, number of employees, industry and the CEO salary. We are interested in understanding which factors affect CEO salary.\n",
    "This is definitely a regression problem since the dependent variable, CEO salary, is not discrete. The question states, \"We are interested in understanding which factors affect CEO salary.\", so it is an inference question.  The goal isn't to predict CEO salary, but to understand what features influence it. The sample size is 500, the number of firms, and it has three features; profit, number of employees, and industry.\n",
    "### (b) We are considering launching a new product and wish to know whether it will be a success or a failure. We collect data on 20 similar products that were previously launched. For each product we have recorded whether it was a success or failure, price charged for the product, marketing budget, competition price, and ten other variables.\n",
    "Success or failure is binary, so this is a classification problem.  The desired answer is prospective, trying to predict what will happen so it is predictive in nature. The sample size is 20, the number of products, and the number of features is 13; product price, marketing budget, competition price and ten others.  Whether it was a success or failure is a dependent variable.\n",
    "### (c) We are interested in predicting the % change in the USD/Euro exchange rate in relation to the weekly changes in the world stock markets. Hence we collect weekly data for all of 2012. For each week we record the % change in the USD/Euro, the % change in the US market, the % change in the British market, and the % change in the German market.\n",
    "Percent change in an exchange rate will have a continuous output so this is a regression problem.  The question states we are interested in predicting the percent change, so the desired answer is prediction.  There are 52 samples, one for each week of the year, and there are 3 features, the percent change in US, Brittish, and German markets.\n",
    "## 7. The table below provides a training data set containing six observations, three predictors, and one qualitative response variable."
