    "## Suppose we wish to use this data set to make a prediction for Y when X1 = X2 = X3 = 0 using K-nearest neighbors.\n",
    "### (a) Compute the Euclidean distance between each observation and the test point, X1 = X2 = X3 = 0.\n",
    "Euclidean Distance formula: sqrt((p1-q1)^2 + (p2-q2)^2+...+(pn-qn)^2.  We need to find the distance between each observation and the origin (0,0,0).  \n",
    "  \n",
    "Observation 1: sqrt(0-0)^2 + (3-0)^2 + (0-0)^2) = 3  \n",
    "Observation 2: sqrt(2-0)^2 + (0-0)^2 + (0-0)^2) = 2  \n",
    "Observation 3: sqrt(0-0)^2 + (1-0)^2 + (3-0)^2) = sqrt(10) ~3.16  \n",
    "Observation 4: sqrt(0-0)^2 + (1-0)^2 + (2-0)^2) = sqrt(5) ~2.24  \n",
    "Observation 5: sqrt(-1-0)^2 + (0-0)^2 + (1-0)^2) = sqrt(2) ~1.41  \n",
    "Observation 6: sqrt(1-0)^2 + (1-0)^2 + (1-0)^2) = sqrt(3) ~1.73  \n",
    "  \n",
    "  \n",
    "  \n",
    "### (b) What is our prediction with K = 1? Why?\n",
    "The nearest neighbor (0, 0, 0) in our dataset is Observation 5 since 1.41 is the closest value and we are only selecting one neighbor. We would predict 'Green'\n",
    "### (c) What is our prediction with K = 3? Why?\n",
    "With K=3, we need to select the three closest neighbors to (0,0,0).  These are observations 5, 6, and 2. The Y values for 5, 6, and 2 are Green, Red and Red.  Since, two fo the three neighbors are red, we would predict Red.\n",
    "### (d) If the Bayes decision boundary in this problem is highly nonlinear, then would we expect the best value for K to be large or small? Why?\n",
    "A large K would smooth or flatten the curve towards linearity.  In this instance it would be better to have a small K. Howver, If too small a K is selected, it may result in overfitting."
   ]
