   "source": [
    "The null hypothesis for the intercept says that if all spending on TV, radio and newspaper marketing was zero, then sales would also be zero.  The null hypothesis for TV, radio and newspapers says that spending in that category does not have an effect on sales.  \n",
    "  \n",
    "Based upon the p-values in the table, it seems that Intercept, TV and radio have low values and the null-hypothesis can be rejected.   For TV and radio, this means that spending in TV and radio has a significant correlation with sales. For intercept, this means that even if all marketing budgets were set to zero, sales would not be zero.\n",
    "\n",
    "However, the p-value for newspaper is very high above the normal threshold of 0.05. This means it would not be appropriate to reject the null hypothesis, and it would be reasonable to assume money spent on newspaper advertising does not have an appreciable impact on sales.\n",
    "## 3. Suppose we have a data set with five predictors, X1 = GPA, X2 = IQ, X3 = Level (1 for College and 0 for High School), X4 = Interaction between GPA and IQ, and X5 = Interaction between GPA and Level. The response is starting salary after graduation (in thousands of dollars). Suppose we use least squares to fit the model, and get βˆ0 = 50, βˆ1 = 20, βˆ2 = 0.07, βˆ3 = 35, βˆ4 = 0.01, βˆ5 = −10.\n",
    "### (a) Which answer is correct, and why?\n",
    "#### i. For a fixed value of IQ and GPA, high school graduates earn more, on average, than college graduates.\n",
    "#### ii. For a fixed value of IQ and GPA, college graduates earn more, on average, than high school graduates.\n",
    "#### iii. For a fixed value of IQ and GPA, high school graduates earn more, on average, than college graduates provided that the GPA is high enough.\n",
    "#### iv. For a fixed value of IQ and GPA, college graduates earn more, on average, than high school graduates provided that the GPA is high enough.\n",
    "The correct answer is iv. Level generally increases salary.  However, the interaction between GPA and Level being negative indicates that GPA has a greater impact on salary for High School graduates than College graduates. That is the advantage conferred by a college degree decreases as GPA increases. In some instances, a high-GPA High School graduate would earn more than a low-GPA college graduate.\n",
    "### (b) Predict the salary of a college graduate with IQ of 110 and a GPA of 4.0.\n",
    "Salary  \n",
    "= βˆ0 + βˆ1 * GPA + βˆ2 * IQ + βˆ3 * Level + βˆ4 * GPA * IQ + βˆ5 * GPA * Level  \n",
    "= 50 + 20 * 4.0 + 0.07 * 110 + 35 * 1 + 0.01 * 4.0 * 110 - 10*4.0*1  \n",
    "= $137,100\n",
    "  \n",
    "### (c) True or false: Since the coefficient for the GPA/IQ interaction term is very small, there is very little evidence of an interaction effect. Justify your answer.\n",
    "False.  The size of the coefficient is not an indicator of the interaction effect.  We would need data concerning the standard error of the coefficient or p-values to justify a null hypothesis."
